pragma solidity ^0.6.0;

import '../Governance/GX_GovernanceAdmin.sol';

/// @author Solidity Services
/// @title Galaxis: Registered DEX-s
/// @notice Simple helper functionalities for registered DEX-s
contract GX_DEXRegistry is GX_GovernanceAdmin {

    /// ENUMS
    /// @notice supported dex types
    enum DEXType {Kyber, ZeroX, Uniswap}

    /// STRUCTS
    struct DEXInfos {
        DEXType dexType;
        address dexAddress;
    }

    // addresses of the decentralized exchanges or exchange adapters
    mapping(uint8 => DEXInfos) dexs;


    /// Exchanges
    // 0: Kyber
    // 1: Uniswap
    // 2: 0x
    ///

    /// EVENTS: user facing events
    /// @notice event for adding a DEX
    event GX_DEXAdded(uint8 indexed num, DEXType dexType, address indexed dexAddress);
    /// @notice event for removing a DEX
    event GX_DEXRemoved(uint8 indexed num);

    /// CONSTRUCTOR

    /// @notice functionality for known parites
    /// @dev ...
    constructor() public {
    }

    /// TRANSACTIONS


    /// @notice adding exchange to the known exchanges
    /// @dev ...
    /// @param _num name and number of the exchange
    /// @param _dexType typer of the dex
    /// @param _dexAddress address of the dex or dex adapter
    function addDEX(uint8 _num, DEXType _dexType, address _dexAddress) public onlyAdmin {
        dexs[_num] = DEXInfos(_dexType,_dexAddress);
        emit GX_DEXAdded(_num, _dexType, _dexAddress);
    }

    /// @notice removing exchange or exchange adapter from the known exchanges
    /// @dev ...
    /// @param _num name and number of the exchange
    function removeDEX(uint8 _num) public onlyAdmin {
        delete dexs[_num];
        emit GX_DEXRemoved(_num);
    }

    /// VIEWS

    /// @notice checking the address of the exchange
    /// @dev ...
    /// @param _nrToCheck nr to check
    function getDEXInfo(uint8 _nrToCheck) public view returns (DEXType, address) {
        return (dexs[_nrToCheck].dexType, dexs[_nrToCheck].dexAddress);
    }
}

